function getRawKmsAppInfo(systemInfo: KmsInfo): Record<string, unknown> {
  // Extract version string, removing git hash part (e.g., "v0.5.3 (git:ca4af023e974427e4153)" -> "v0.5.3")
  const version = systemInfo.version.split(' ')[0]
  const chainId = systemInfo.chain_id

  // Extract prod environment from URL (e.g., "https://kms.dstack-base-prod7.phala.network" -> "prod7")
  const prodMatch = systemInfo.url.match(/dstack-.*?-(.+)\.phala\.network/)
  const prodEnv = prodMatch ? prodMatch[1] : null

  // Return appropriate raw JSON object based on prod environment, chain_id, and version
  switch (prodEnv) {
    case 'prod6':
      switch (chainId) {
        case 1: // Ethereum mainnet
          switch (version) {
            case 'v0.5.3':
              return prod6EthV053
            default:
              throw new Error(
                `Unsupported version ${version} for prod6 chain ${chainId}`,
              )
          }
        case 8453: // Base mainnet
          switch (version) {
            case 'v0.5.1':
              return prod6BaseV051
            case 'v0.5.3':
              return prod6BaseV053
            default:
              throw new Error(
                `Unsupported version ${version} for prod6 chain ${chainId}`,
              )
          }
        case null: // Phala hosted
          switch (version) {
            case 'v0.5.4':
              return prod6PhalaV054
            default:
              throw new Error(
                `Unsupported version ${version} for prod6 offchain`,
              )
          }
        default:
          throw new Error(`Unsupported chain ID: ${chainId} for prod6`)
      }
    case 'prod7':
      switch (chainId) {
        case 1: // Ethereum mainnet
          switch (version) {
            case 'v0.5.3':
              return prod7EthV053
            default:
              throw new Error(
                `Unsupported version ${version} for prod7 chain ${chainId}`,
              )
          }
        case 8453: // Base mainnet
          switch (version) {
            case 'v0.5.3':
              return prod7BaseV053
            default:
              throw new Error(
                `Unsupported version ${version} for prod7 chain ${chainId}`,
              )
          }
        case null: // Phala hosted
          switch (version) {
            case 'v0.5.3':
              return prod7PhalaV053
            default:
              throw new Error(
                `Unsupported version ${version} for prod7 offchain`,
              )
          }
        default:
          throw new Error(`Unsupported chain ID: ${chainId} for prod7`)
      }
    default:
      throw new Error(`Unsupported prod environment: ${prodEnv}`)
  }
}

export function getKmsAppInfo(systemInfo: KmsInfo): AppInfo {
  const rawAppInfo = getRawKmsAppInfo(systemInfo)
  return parseJsonFields<AppInfo>(rawAppInfo, {
    tcb_info: TcbInfoSchema,
    key_provider_info: KeyProviderSchema,
    vm_config: VmConfigSchema,
  })
}
